(1368, 1560, 1, '<p>\nGanhe [[[PORCENTAGEM]]]% de cada venda, você pode consultar um site a este! Você pode ganhar dinheiro com uma atualização dos usuários de duas maneiras:\n</ p>\n<ol class = \"rewardsTextList\">\n<li> Usando seu nome de filial de afiliado, basta ligar ao site através do seu site existente. Você ganhará [[[PORCENTAGEM]]]% para qualquer Usuário que se registre em uma conta e depois atualize. </ Li>\n<li> Dos usuários que atualizam para baixar arquivos na sua conta. </ li>\n</ ol>\n<p>\nComece carregando e compartilhando seus arquivos ou ligando seu site em seu nome de afiliado, como este:\n</ p>\n<ul>\n<li> <a href=\"[[[WEB_ROOT]]]/?aff=[[[AFFILIATE_KEY]]]\"> [[[WEB_ROOT]] /? aff = [[[AFILIATE_KEY]]] </a> </ li>\n</ ul>', 1),
(1369, 1561, 1, '<p>\n                    Ganhe [[[PORCENTAGEM]]]% de cada venda, você se refere a este site! Você pode ganhar dinheiro com a atualização de usuários de duas maneiras:\n                </ p>\n                <ol class = \"rewardsTextList\">\n                    <li> Usando seu id exclusivo de afiliado, basta ligar ao site através do seu site existente. Você ganhará [[[PORCENTAGEM]]]% para qualquer usuário que se registre em uma conta e depois atualize. </ Li>\n                    <li> Dos usuários que atualizam para baixar arquivos na sua conta. </ li>\n                </ ol>\n                <p> <strong> Quanto você pode ganhar? </ strong> </ p>\n                \n                <p> Com base nas atualizações [[[MONTHLY_UPGRADE_EXAMPLE]]] e cada atualização custando [[[SITE_CONFIG_COST_CURRENCY_SYMBOL]]] [[[SITE_CONFIG_COST_FOR_30_DAYS_PREMIUM]]] por mês, você pode ganhar o seguinte: </ p>', 1),
