(102817, 812, 2, '<strong> TOS básicos </ strong> <br/>\n<br/>\nTodos os usuários têm condições de pagar 13 anos e concordam em não usar o serviço [[[SITE_NAME]] para pares ilegais ou não autorizados. Todos os usuários devem concordar em cumprir como leis locais sobre a conduta online e como leis de direitos autorais. [[[SITE_NAME]] é destinado a uso pessoal, e qualquer uso comercial é estritamente proibido. Todos os usuários não estão à disposição dos serviços do [[[SITE_NAME]] para violar leis que incluem, mas não estão limitados às leis de direitos autorais. Qualquer violação resultará em exclusão de todos os arquivos [[[SITE_NAME]]] em registro para o seu endereço IP. <br/>\n<br/>\nTodos os usuários usam [[[SITE_NAME]] por sua conta e risco, os usuários entendem os arquivos carregados em [[[SITE_NAME]] não são privados, podem ser exibidos para que outros vejam e [[[SITE_NAME]]] usuários Compreender e concordar que [[[SITE_NAME]] não pode ser responsável pelo conteúdo publicado no seu site e no entanto, pode estar exposto a materiais e que você use o serviço [[[SITE_NAME]]] por sua conta e risco . <br/>\n<br/>\n<strong> Condições </ strong> <br/>\n<br/>\n- Reservamo-nos o direito de modificar ou encerrar o serviço [[[SITE_NAME]] por qualquer motivo, sem aviso prévio a qualquer momento. <br/>\n- Reservamo-nos o direito de alterar estes Termos de Uso a qualquer momento. <br/>\n- Reservamo-nos o direito de recusar serviço a qualquer pessoa por qualquer motivo a qualquer momento. <br/>\n- Podemos, mas não existe obrigação, remover Conteúdo e contas que contém Conteúdo que determina o nosso critério exclusivo são ilegais, ofensivos, ameaçadores, difamatórios, difamatórios, obscenos ou de outra forma censuráveis ​​ou violam uma propriedade intelectual de qualquer parte ou estes Termos de Uso. <br/>\n- Se há um usuário e usando [[[SITE_NAME]] para hospedar ícones, smileys, ícones de amigos, avatares de fóruns, insígnias de fórum, imagens de assinatura de fórum ou qualquer outro gráfico para design do site, todas como suas imagens são removidas . <br />\n<br/>\n<strong> Informações de direitos autorais </ strong> <br/>\n<br/>\n[[[SITE_NAME]] não reivindica direitos de propriedade intelectual sobre como imagens carregadas pelos seus usuários. <br/>\n<br/>\n[[[SITE_NAME]]] rever todos os direitos autorais e cópias; Reclamações de reembolso e remoção de arquivos encontrados para terem sido carregados ou distribuídos em violação de tais leis. Para fazer uma reivindicação válida, você pode fornecer [[[SITE_NAME]] com as seguintes informações: <br/>\n<br/>\n- Uma assinatura física ou eletrônica do Direito dos direitos autorais ou uma pessoa autorizada em seu nome; <br/>\n- Uma descrição do trabalho protegido por direitos autorais alegou ter sido violada; <br/>\n- Uma descrição do material e informações infratórias razoavelmente suficientes para permitir [[[SITE_NAME]]] localizar o material; <br/>\n- Sua informação de contato, incluindo seu endereço, número de telefone e e-mail; <br/>\n- Uma declaração de que você acredita de boa fé com o uso do material da maneira não é autorizado pelo Departamento de direitos autorais, pelo seu agente ou pela lei; e <br/>\n- Uma declaração de que é uma informação na notificação e precisa, sob as dores e penalidades do perjúrio, que você está autorizado a agir no nome do proprietário dos direitos autorais. <br/>\n<br/>\nComo reivindicações podem ser enviadas por nós através da página <a href=\"report_file.[[[PAGE_EXTENSION]]]\"> denunciar abuso </a>.', 1),
